import React from 'react-dom';

export default class PayForms extends React.Component {
  render() {
    return (
      <form>
        <label htmlFor="fullname">
          Nome:
          <input type="text" name="fullname" />
        </label>
        <input type="submit" value="Enviar" />
      </form>
    );
  }
}
